import './App.css';

import React, { Component } from 'react'
import Navbar from './Component/Navbar';
import News from './Component/News';

import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";

export default class App extends Component {
  render() {
    return (
      <div>
        <Router>
          <Navbar />
          <Routes>
            <Route path="/business" key={business} element={<News category="business" />} />
            <Route path="/entertainment" key={entertainment} element={<News category="entertainment" />} />
            <Route path="/general" key={general}  element={<News category="general" />} />
            <Route path="/health" key={health} element={<News category="health" />} />
            <Route path="/science" key={science}  element={<News category="science" />} />
            <Route path="/sports" key={sports} element={<News category="sports" />} />
            <Route path="/technology" key={technology} element={<News category="technology" />} />
          </Routes>
        </Router>
      </div>
    )
  }
}
